import{_ as a,c as r,o as t,ae as s}from"./chunks/framework.E0AgsPhI.js";const u=JSON.parse('{"title":"APIs & Libraries","description":"","frontmatter":{},"headers":[],"relativePath":"ecosystem/index.md","filePath":"ecosystem/index.md"}'),o={name:"ecosystem/index.md"};function i(n,e,l,c,p,h){return t(),r("div",null,[...e[0]||(e[0]=[s('<h1 id="apis-libraries" tabindex="-1">APIs &amp; Libraries <a class="header-anchor" href="#apis-libraries" aria-label="Permalink to &quot;APIs &amp; Libraries&quot;">​</a></h1><p>Arcsecond.io is a software <em>system</em>. Behind the webapp available on any navigator, there are various other associated services and projects.</p><ul><li><a href="./apis">APIs</a> - our backend RESTful APIs.</li><li><a href="./aa-js">aa-js</a> - our open-source library of astronomical algorithms in Typescript.</li><li><a href="./cli">CLI</a> - our open-source Command-Line Interface (a.k.a. the <code>arcsecond</code> terminal command).</li></ul><h2 id="support-services-repositories" tabindex="-1">Support services &amp; repositories <a class="header-anchor" href="#support-services-repositories" aria-label="Permalink to &quot;Support services &amp; repositories&quot;">​</a></h2><p>In addition to that, we&#39;ve put in place an external <a href="https://status.arcsecond.io" target="_blank" rel="noreferrer">Status Page</a> which monitor the availability of the various parts of our system, and send us alerts when something becomes unreachable.</p><p>On GitHub we also published a <a href="https://github.com/arcsecond-io/standard-stars-catalogues" target="_blank" rel="noreferrer">repository</a> where 17 catalogues of standard stars were formatted and unified. These are catalogues found in the various pages of the websites of <a href="https://www.eso.org/sci/observing/tools/standards.html" target="_blank" rel="noreferrer">ESO</a>, <a href="https://www2.keck.hawaii.edu/inst/common/landolt_stds.html" target="_blank" rel="noreferrer">Keck</a>, <a href="http://www.ukirt.hawaii.edu/astronomy/" target="_blank" rel="noreferrer">UKIRT</a>, <a href="https://www.gemini.edu/sciops/instruments/gmos/calibration/photometric-stds" target="_blank" rel="noreferrer">Gemini</a>, <a href="http://catserver.ing.iac.es/landscape/index.php" target="_blank" rel="noreferrer">IAC</a> and the <a href="http://www.not.iac.es/observing/forms/landscape/v1.4/www/" target="_blank" rel="noreferrer">NOT</a>.</p><p>There&#39;s also a public issues repository (but it isn&#39;t much used, people prefer to reach us directly).</p><h2 id="contact" tabindex="-1">Contact <a class="header-anchor" href="#contact" aria-label="Permalink to &quot;Contact&quot;">​</a></h2><p>And finally, we are reachable for any question, suggestions or bug reports in multiple ways:</p><ul><li>Our email is <a href="mailto:team@arcsecond.io" target="_blank" rel="noreferrer">team@arcsecond.io</a></li><li>We have a <a href="https://join.slack.com/t/arcsecond-io/shared_invite/zt-yvsehzjl-jExYLVWzwuslMJum7r2GiA" target="_blank" rel="noreferrer">Slack</a> (open and free)</li></ul><p>Sorry, we don&#39;t use our Twitter/X account anymore, considering the awful state of this platform.</p>',11)])])}const m=a(o,[["render",i]]);export{u as __pageData,m as default};
